import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Homepage from './homepage.js';
import icon from './icon.png';
import me from './me.jpg';
import './App.css';
import Socials from './socials.js';
//import logo from './logo.svg';

class AboutMe extends Component {

  render() {
  return (
    <div>
      <div>
        <Link to='/' style={{textDecoration: "none"}}>
          <img src={icon} style={{height: '125px', bottom: '20px', zIndex: '2', marginRight: '15px'}}></img>
        </Link>
        </div>
        <div style={{display: 'flex', flexDirection: 'row', justifyContent: 'center'}}>
        <img className="Photo" src={me} style={{height: '400px', bottom: '20px', zIndex: '2', borderWidth: '20px', borderColor: '#000000'}}></img>

        <div style={{backgroundColor: '#ff0d4d', padding: '15px', marginLeft: '20px', borderRadius: 3, width: '280px'}}>
            <h4 className="name">Julia Opatrny</h4>
            <h6 style={{marginTop: '-22px', fontStyle: 'italic'}} className="name">jsopatrny@gmail.com</h6>
            <h6 style={{marginTop: '-25px'}}>(917) 208-2775</h6>
            <body style={{marginTop: '-10px', fontSize: '15px', marginBottom: '12px'}} className="name">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.
            </body>
          </div>
        </div>
        <Socials style={{position: 'absolute', bottom: '10px'}}/>
    </div>
  );
  }
}


export default AboutMe;
